      for (i=0;i<25;i++){ console.log(allteams[teamrpi[i][0]],teamrpi[i][1],teamrpi[i][2],teamrpi[i][3],teamrpi[i][4],teamrpi[i][5],teamrpi[i][6],teamrpi[i][7]);}
      nrows = Math.min(document.getElementById('nRows').value,1000);
